export default class VoitureListe extends Component {
    render() {
        return (
            <Card className='border border-dark bg-dark text-white mt-4'>
                <Card.Header className="text-white"><FontAwesomeIcon icon={faList} />Liste Voitures</Card.Header>
                <Card.Body>
                    <table  bordered hover striped variant="dark" className="table table-striped">
                        <thead>
                            <tr>
                                <th>Marque</th>
                                <th>Modele</th>
                                <th>Couleur</th>
                                <th>Annee</th>
                                <th>Prix</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr align="center">
